script: |
  super -f tsv -I q200.sql | sort > q200.out

vector: true

inputs:
  - name: q200.sql
    data: |
      SELECT ALL - 5 - COUNT ( * ) AS col1 FROM tab1 WHERE NOT 60 * col0 + + col2 * col2 NOT BETWEEN ( - col0 + col0 ) AND + col2 + - col2 * 83;
  - name: tab1

outputs:
  - name: q200.out
    data: |
      -5
